                            เข้าสู่ระบบ
                    </button>
                    <p class="mt-5 mb-3 text-muted">มีบัญชีสมาชิกแล้ว?<a href="Login.js">เข้าสู่ระบบ</a></p> 
                </form>
            </main>
        </div>
    </div>
    )
}


export default Register
